BEGIN TRANSACTION;
CREATE TABLE `web_track` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(24) NOT NULL, `race_id` integer NOT NULL REFERENCES `web_race` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE `web_team` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `start_no` decimal NOT NULL, `car_id` integer NOT NULL REFERENCES `web_car` (`id`) DEFERRABLE INITIALLY DEFERRED, `driver_id` integer NOT NULL REFERENCES `web_person` (`id`) DEFERRABLE INITIALLY DEFERRED, `navigator_id` integer NULL REFERENCES `web_person` (`id`) DEFERRABLE INITIALLY DEFERRED, `race_id` integer NOT NULL REFERENCES `web_race` (`id`) DEFERRABLE INITIALLY DEFERRED, `tclass_id` integer NOT NULL REFERENCES `web_carclass` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE `web_race` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(256) NOT NULL, `place` varchar(256) NOT NULL, `start_date` datetime NOT NULL, `end_date` datetime NOT NULL, `finished` bool NOT NULL, `race_type` varchar(24) NOT NULL);
CREATE TABLE `web_person` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(24) NOT NULL, `surname` varchar(24) NOT NULL, `nick` varchar(24) NULL, `mail` varchar(24) NULL, `desc` varchar(200) NULL, `race_licence` bool NOT NULL, `phone_tel` varchar(24) NULL);
CREATE TABLE `web_lap` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `taryfa` bool NOT NULL, `fee` decimal NOT NULL, `start_time` time NULL, `stop_time` time NULL, `team_id` integer NULL REFERENCES `web_team` (`id`) DEFERRABLE INITIALLY DEFERRED, `track_id` integer NULL REFERENCES `web_track` (`id`) DEFERRABLE INITIALLY DEFERRED, `result` bigint NOT NULL, `result_plus_fee` bigint NOT NULL, `result_taryfa` bigint NOT NULL);
CREATE TABLE `web_carclass` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(24) NOT NULL, `type` varchar(24) NOT NULL, `cap_min` decimal NOT NULL, `cap_max` decimal NOT NULL);
CREATE TABLE `web_car` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `manufacurer` varchar(24) NOT NULL, `model` varchar(24) NOT NULL, `desc` varchar(24) NOT NULL, `engine_model` varchar(24) NULL, `fuel` varchar(24) NOT NULL, `accel_type` varchar(24) NULL, `power` decimal NULL, `engine_capacity` decimal NOT NULL, `wankel` bool NOT NULL, `hybrid` bool NOT NULL, `torque` decimal NULL);
CREATE TABLE `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` text NOT NULL, `expire_date` datetime NOT NULL);
CREATE TABLE `django_migrations` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `app` varchar(255) NOT NULL, `name` varchar(255) NOT NULL, `applied` datetime NOT NULL);
CREATE TABLE `django_content_type` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `app_label` varchar(100) NOT NULL, `model` varchar(100) NOT NULL);
CREATE TABLE `django_admin_log` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `object_id` text NULL, `object_repr` varchar(200) NOT NULL, `action_flag` smallint unsigned NOT NULL, `change_message` text NOT NULL, `content_type_id` integer NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `action_time` datetime NOT NULL);
CREATE TABLE `auth_user_user_permissions` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE `auth_user_groups` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE `auth_user` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `password` varchar(128) NOT NULL, `last_login` datetime NULL, `is_superuser` bool NOT NULL, `username` varchar(150) NOT NULL UNIQUE, `first_name` varchar(30) NOT NULL, `email` varchar(254) NOT NULL, `is_staff` bool NOT NULL, `is_active` bool NOT NULL, `date_joined` datetime NOT NULL, `last_name` varchar(150) NOT NULL);
CREATE TABLE `auth_permission` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `content_type_id` integer NOT NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `codename` varchar(100) NOT NULL, `name` varchar(255) NOT NULL);
CREATE TABLE `auth_group_permissions` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE `auth_group` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(80) NOT NULL UNIQUE);
